import React from "react";

const Incorrectinfo = ({ option }) => {
  return (
    <>
      <div className="chat-thread-right">
        <p>No, it looks incorrect</p>
      </div>
      <div className="chat-thread-left">
        <p>Please help us understand your concern by selecting your issue</p>
        <ul className="options">
          {option.map((issues) => {
            return <li key={option.options}>{issues.options}</li>;
          })}
        </ul>
      </div>
    </>
  );
};

export default Incorrectinfo;
